class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

class Solution:
    def max_edges(self, root: TreeNode) -> int:
        self.max_edges = 0
        self.connected = set()
        self.connected.add(root.val)
        self.helper(root)
        return self.max_edges

    def helper(self, root: TreeNode):
        if not root:
            return 0
        left_edges = self.helper(root.left)
        right_edges = self.helper(root.right)
        if left_edges == 0 or right_edges == 0:
            self.max_edges += 1
        if root.val not in self.connected:
            self.max_edges += 1
            self.connected.add(root.val)
        return max(left_edges, right_edges) + 1

